export function add43(a: number, b: number): number {
  return a + b;
}

export function subtract43(a: number, b: number): number {
  return a - b;
}

export function multiply43(a: number, b: number): number {
  return a * b;
}

export function divide43(a: number, b: number): number {
  return a / b;
}
